/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `before_insert_sys_user` BEFORE INSERT ON `bz_user` FOR EACH ROW BEGIN
	
set @existUser = (select count(*) from bz_sys_user where id = NEW.sys_user_id);

IF @existUser = 0 THEN
	INSERT INTO bz_sys_user (
		id,
		active_user_id,
        id_no,
        login_id,
        name,
        phone,
        password,
        email,
        del_status,
        lock_status,
        work_status,
        gmt_create)
    values(
		NEW.sys_user_id,
		NEW.uuid,
        NEW.id_no,
        NEW.login_id,
        NEW.name,
        NEW.phone,
        NEW.password,
        NEW.email,
        NEW.del_status,
        NEW.lock_status,
        NEW.work_status,
        now());
ELSE
	  UPDATE bz_sys_user SET 
		active_user_id = NEW.uuid,
        name = NEW.name,
        phone = NEW.phone,
        password = NEW.password,
        email = NEW.email,
        del_status = 0,
        lock_status = 0,
        work_status = 0
		WHERE  id = NEW.sys_user_id;
	
END IF;
  
END */;;
DELIMITER ;
