/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_sys_user` AFTER UPDATE ON `bz_user` FOR EACH ROW BEGIN
	UPDATE bz_sys_user SET 
    name=NEW.NAME,
    password=NEW.password,
    phone=NEW.phone,
    email=NEW.email,
    login_id = NEW.login_id,
    del_status=NEW.del_status,
    lock_status=NEW.lock_status,
    work_status=NEW.work_status
    WHERE id = OLD.sys_user_id and active_user_id = OLD.uuid;
END */;;
