/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `bz_user_AFTER_DELETE` AFTER DELETE ON `bz_user` FOR EACH ROW BEGIN

set @CNT = (select count(*) from bz_user where sys_user_id = OLD.sys_user_id);
IF @CNT = 0 THEN
	DELETE FROM bz_sys_user WHERE id = OLD.sys_user_id;
ELSE
	UPDATE bz_sys_user SET active_user_id = null WHERE id = OLD.sys_user_id;
END IF;
	
END */;;
